import "./Sidebar.css";
import React from "react";
import '../Landing/Landing.css'
import Sidebarelements from './components/Sidebar/sidebar.elements';
function Sidebar() {
    return (
        <>
            <div className="App falla">
                <Sidebar width={225} height={"100vh"}>
                    <a>Home</a>
                    <a>Noticias</a>
                    <a>Creador</a>
                    <a>Usuario </a>
                    <a>Reproductor</a>
                </Sidebar>
            </div>
        </>
    );
}

export default Sidebar;
